import React from 'react';
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom';
import './App.css';
import Header from "./Header";

function App() {
  return (
      <Router>
          <div className="app">
              <Switch>
                  <Route path="/checkout">
                      <h1>Checkout</h1>
                  </Route>
                  <Router path = "/login">
                      <h1>Login page</h1>
                  </Router>
                  <Router path = "/">
                      <Header/>
                        <h1>Home page</h1>
                  </Router>
              </Switch>
          </div>
      </Router>

  );
}

export default App;
